  /**
   * Transition end event for Local Video
   */
  this._video_subview_transitionend = function(evt)
  {
    this._dom_local_video.classList.remove( 'with-touchmove' );
    this._refresh_video();
  };

  /**
   * Touch start event for Remote Video
   */
  this._video_fullview_touchstart = function(evt)
  {
    if(!this._fullscreen){
      this._video_fullview_dragging = true;
      this._diff_x_remote = evt.touches[0].clientX - this._dom_call_wrapper_object.offsetLeft;
      this._diff_y_remote = evt.touches[0].clientY - this._dom_call_wrapper_object.offsetTop;
      this._dom_call_wrapper_object.classList.add( 'with-touchmove' );
    }
  };

  /**
   * Touch move event for Remote Video
   */
  this._video_fullview_touchmove = function(evt)
  {
    //evt.preventDefault();
    if (this._video_fullview_dragging)
    {
      var left = evt.touches[0].clientX - this._diff_x_remote ;
      var top  = evt.touches[0].clientY - this._diff_y_remote ;
      // Check screen boundaries to avoid position video outside viewable part.
      if( top < 0 )
      {
       top = 0;
      }

      if( left < 0 )
      {
       left = 0;
      }

      // Check taking into account remote video size.
      if( top > window.innerHeight - this._dom_call_wrapper_object.clientHeight )
      {
        top = window.innerHeight - this._dom_call_wrapper_object.clientHeight;
      }

      if( left > window.innerWidth - this._dom_call_wrapper_object.clientWidth )
      {
        left = window.innerWidth - this._dom_call_wrapper_object.clientWidth;
      }
      this._dom_call_wrapper_object.style.left = left + 'px';
      this._dom_call_wrapper_object.style.top = top + 'px';
      this._refresh_video();
    }
  };

  /**
   * Touch end event for Remote Video
   */
  this._video_fullview_touchend = function(evt)
  {
    if(this._video_fullview_dragging)
    {
      this._video_fullview_dragging = false;
      var subview_top_padding = 50;
      var left = this._subview_left_right_padding;
      var top = subview_top_padding;

      var halfwidth = parseInt(window.innerWidth / 2);
      var halfheight = parseInt(window.innerHeight / 2);

      var centerX = this._dom_call_wrapper_object.offsetLeft + parseInt (this._dom_call_wrapper_object.clientWidth /2);
      var centerY = this._dom_call_wrapper_object.offsetTop + parseInt(this._dom_call_wrapper_object.clientHeight /2);

      // Check taking into account remote video size.
      if( (centerX < halfwidth) && (centerY < halfheight) ) //  Left, Top
      {
        left = this._subview_left_right_padding;
        top =  subview_top_padding;
        this._subview_horizontal_position = false;
        this._subview_vertical_position = true;
      }

      if( (centerX < halfwidth) && (centerY > halfheight) )//  Left, Bottom
      {
        left = this._subview_left_right_padding;
        top = window.innerHeight - this._dom_call_wrapper_object.clientHeight - this._subview_bottom_padding;
        this._subview_horizontal_position = false;
        this._subview_vertical_position = false;
      }

      if( (centerX > halfwidth) && (centerY < halfheight) )//  Right, Top
      {
        left = window.innerWidth - this._dom_call_wrapper_object.clientWidth - this._subview_left_right_padding;
        top = subview_top_padding;
        this._subview_horizontal_position = true;
        this._subview_vertical_position = true;
      }

      if( (centerX > halfwidth) && (centerY > halfheight) )//  Right, Bottom
      {
        left = window.innerWidth - this._dom_call_wrapper_object.clientWidth - this._subview_left_right_padding;
        top = window.innerHeight - this._dom_call_wrapper_object.clientHeight - this._subview_bottom_padding;
        this._subview_horizontal_position = true;
        this._subview_vertical_position = false;
      }

      this._dom_call_wrapper_object.style.left = left + 'px';
      this._dom_call_wrapper_object.style.top = top + 'px';
      [0, 300].forEach(function (delay) {
        setTimeout(function () {
          this._refresh_video();
        }, delay);
      });
    }
  };

