/**
 * Factory to get an instance of the specific softphone type
 *
 */
CommExt.define( 'Comm.SoftphoneFactory',
{
  singleton: true,


  /**
   * Intellivic type
   *
   * @property {String}
   */
  TYPE_INTELLIVIC: 'intellivic',


  /**
   * WebRTC type
   *
   * @property {String}
   */
  TYPE_WEBRTC: 'webrtc',


  /**
   * Get the "best" available softphone
   *
   * @return {Comm.core.Softphone}
   */
  get_preferred_softphone: function()
  {
    if( Comm.core.Capabilities.is_webrtc_installed() )
    {
      return this.get_softphone_type( this.TYPE_WEBRTC );
    }

    //if( Comm.core.Capabilities.is_intellivic_installed() )
    //{
    //  return this.get_softphone_type( this.TYPE_INTELLIVIC );
    //}

    return null;
  },



  /**
   * Get an explicit kind of SoftPhone
   *
   * @param {String} type One of TYPE_* properties
   * @param {String=} id An optional identifier for the phone
   * @param {Object=} options
   * @return {Comm.intellivic.Softphone|Comm.webrtc.Softphone}
   */
  get_softphone_type: function( type, id, options )
  {
    switch( type )
    {
      case this.TYPE_INTELLIVIC:
        return new Comm.intellivic.Softphone( id, options );

      case this.TYPE_WEBRTC:
        return new Comm.webrtc.Softphone( id, options );

      default:
        return null;
    }
  }

});

/**
 * Generic javascript logger for all the platforms.
 *
 * #Examples:
 *
 * Set level to be displayed on the console
 *
 *     Comm.Log.displayLevel = Comm.Log.LEVEL_DEBUG;
 *
 *
 * Log methods by level
 *
 *     Comm.Log.debug( 'text', { a: 1 }, function(){} );
 *     Comm.Log.error( 'text' );
 *
 * Show the log:
 *
 *     Comm.Log.show_log();
 *
 */
CommExt.define( 'Comm.utils.Logger',
{
  alternateClassName: 'Comm.Log',
  singleton: true,
  extend: 'CommExt.util.Observable',


  /** Debug Level constant @property {Number} */
  LEVEL_DEBUG: 1,

  /** Info Level constant @property {Number} */
  LEVEL_INFO: 2,

  /** Notice Level constant @property {Number} */
  LEVEL_NOTICE: 3,

  /** Warning Level constant @property {Number} */
  LEVEL_WARN: 4,

  /** Error Level constant @property {Number} */
  LEVEL_ERROR: 5,


  /**
   * Level from which log will be displayed
   *
   * @property {Number}
   */
  displayLevel: 1,


  /**
   * Logs buffer
   *
   * @property {Array}
   * @private
   */
  _buffer: [],


  /**
   * Max logs to store in the buffer
   *
   * @property {Number}
   */
  max_buffer: 750,



  /**
   * Returns time as string
   *
   * @return {String}
   * @private
   */
  _getTime: function()
  {
    var now = new Date();
    return now.getHours() + ':' + now.getMinutes() + ':' + now.getSeconds() + '.' + now.getMilliseconds();
  },



  /**
   * Logs a message
   *
   * @param {Number} level
   * @param {Array} parameters
   * @private
   */
  _log: function( level, parameters )
  {
    // Check if the level is allowed to be displayed
    if( level < this.displayLevel )
    {
      return;
    }

    try
    {
      // Workaround: if params is arguments this converts to a veritable Array type
      var params = Array.prototype.slice.apply( parameters );

      // Convert params to display in IE console
      if( CommExt.isIE )
      {
        CommExt.Array.each( params, function( item, index, allItems )
        {
          if( typeof item == 'object' )
          {
            // Encoding large objects could increase browser timings
            //allItems[ index ] = ' ' + JSON.stringify( item );
          }

          if( typeof item == 'function' )
          {
            allItems[ index ] = ' ' + item.toString();
          }
        }, this );
      }

      var args = [ this._getTime() + ' -' ].concat( params );

      if( this._buffer.length >= this.max_buffer )
      {
        // This formula allows "max" to change (via debugger), where the more obvious "max/4" would not quite be the same
        CommExt.Array.erase( this._buffer, 0, this._buffer.length - 3 * Math.floor( this.max_buffer / 4 ) ); // Keep newest 75%
      }

      var buffer_log = [ this.get_level_name( level ), args ];
      this._buffer.push( buffer_log );

      this.fireEvent( 'beforelog', buffer_log );
      this.fireEvent( this.get_level_name( level ), params );

      var method;

      switch( level )
      {
        case this.LEVEL_DEBUG: // "console.debug" not exists in IE<10
          method = console.log;
          break;

        case this.LEVEL_INFO:
          method = console.info;
          break;

        case this.LEVEL_NOTICE:
          method = console.info;
          break;

        case this.LEVEL_WARN:
          method = console.warn;
          break;

        case this.LEVEL_ERROR:
          method = console.error;
          break;

        default:
          method = console.log;
          break;
      }

      if( !method.apply ) // IE<10
      {
        // Workaround for IE: "console.xx.apply" is undefined
        Function.prototype.apply.apply( method, [ console, args ] );
      }
      else
      {
        method.apply( console, args );
      }
    }
    catch( exc ){ /* Nothing to do */ }
  },



  /**
   * Debug log
   */
  debug: function()
  {
    this._log( this.LEVEL_DEBUG, arguments );
  },



  /**
   * Info log
   */
  info: function()
  {
    this._log( this.LEVEL_INFO, arguments );
  },



  /**
   * Notice log
   */
  notice: function()
  {
    this._log( this.LEVEL_NOTICE, arguments );
  },



  /**
   * Warning log
   */
  warn: function()
  {
    this._log( this.LEVEL_WARN, arguments );
  },



  /**
   * Warning log
   * For backward compatibility.
   */
  warning: function()
  {
    this._log( this.LEVEL_WARN, arguments );
  },



  /**
   * Error log
   */
  error: function()
  {
    this._log( this.LEVEL_ERROR, arguments );
  },



  /**
   * Returns the level name by given level number
   *
   * @param {Number} level
   * @return {String}
   */
  get_level_name: function( level )
  {
    switch( level )
    {
      case this.LEVEL_DEBUG:
        return 'debug';

      case this.LEVEL_INFO:
        return 'info';

      case this.LEVEL_NOTICE:
        return 'notice';

      case this.LEVEL_WARN:
        return 'warn';

      case this.LEVEL_ERROR:
        return 'error';

      default:
        throw 'Level not found';
    }
  }

});

