/**
 * Model a SIP URI according to RFC3261
 *
 * A SIP URI is of the form:
 *
 * "John Doe" <sip:john@domain.example.org:5060?foo=bar>;q=0.1
 *
 */
CommExt.define( 'Comm.uri.SipUri',
{
  extend: 'Comm.uri.AbstractUri',
  statics:
  {
    /**
     * Default SIP Port
     *
     * @property {Number}
     */
    DEFAULT_SIP_PORT: 5060,


    /**
     * SIP URI schema prefix
     *
     * @property {String}
     */
    SCHEMA_SIP: 'sip',


    /**
     * Secure SIP schema prefix
     *
     * @property {String}
     */
    SCHEMA_SIPS: 'sips'
  },


  /**
   * This URI schema ("sip" in the example)
   *
   * @property {String}
   */
  schema: null,


  /**
   * This URI User info ("John Doe" in the example, sans quotes)
   *
   * @property {String}
   */
  userinfo: null,


  /**
   * The user part ("john")
   *
   * @property {String}
   */
  user: null,


  /**
   * The host part ("domain.example.org")
   *
   * @property {String}
   */
  host: null,


  /**
   * The port (5060 in the example, if unset 5060 is assumed but not printed)
   *
   * @property {Number}
   */
  port: null,


  /**
   * URI parameters, splitted by & (after the ?, in the example [ "foo=bar" ])
   *
   * @property {String[]}
   */
  uri_parameters: [],


  /**
   * Header parameters, after >, splitted by ; (in the example ["q= 0.1"])
   *
   * @property {String[]}
   */
  header_parameters: [],



  /**
   * Constructor
   *
   * @param {String} sipaddress
   */
  constructor: function( sipaddress )
  {
    this._uri = sipaddress;
    this.parse( sipaddress );
    this.callParent( arguments );
  },



  /**
   * Test if a SIP address represents the SAME PERSON ("same mail address").
   *
   * @param {String|Comm.uri.SipUri} uri
   * @return {Boolean}
   */
  same_address_as: function( uri )
  {
    if( CommExt.isString( uri ) )
    {
      uri = new Comm.uri.SipUri( uri );
    }

    if( uri instanceof Comm.uri.SipUri )
    {
      return this.get_address() == uri.get_address();
    }

    return false;
  },



  /**
   * Parse a string into this object
   *
   * @param {String} str
   */
  parse: function( str )
  {
    var parts = [];
    str = ( str || '' ).replace( /^\s+|\s+$/g, '' );
    var mailaddr = /([A-Za-z0-9\._]+)@([A-Za-z0-9\._-]+)/;
    var basic_uri = /(sips?):([^@]+)@([^:]+)(:[0-9]+)?(;.*)?/;
    var has_userinfo = /(.*)<(.*)>(.*)/;

    if( has_userinfo.test( str ) )
    {
      var splitted = has_userinfo.exec( str );
      this.userinfo = splitted[ 1 ];
      this.header_parameters = splitted[ 3 ] ? splitted[ 3 ].split( ';' ) : [];
      str = splitted[ 2 ];
    }

    if( basic_uri.test( str ) )
    {
      parts = basic_uri.exec( str );
      this.schema = parts[ 1 ];
      this.user = parts[ 2 ];
      this.host = parts[ 3 ];
      this.port = parts[ 4 ] ? parts[ 4 ].slice( 1 ) : null;
      this.uri_parameters = parts[ 5 ] ? parts[ 5 ].split( ';' ) : [];
    }
    else if( mailaddr.test( str ) )
    {
      parts = mailaddr.exec( str );
      this.schema = this.SCHEMA_SIP;
      this.user = parts[1];
      this.host = parts[2];
    }
    else
    {
      throw 'Unable to parse address ' + str;
    }
  },



  /**
   * Get the user@host part of the address
   *
   * @return {String}
   */
  get_address: function()
  {
    return this.user + '@' + this.host;
  },



  /**
   * Get the full representation of the URI
   *
   * @return {String}
   */
  toString: function()
  {
    var base = this.schema + ':';
    base = base + this.get_address();

    if( this.schema == this.SCHEMA_SIP && this.port != null && this.port != this.DEFAULT_SIP_PORT )
    {
      base = base + ':' + this.port;
    }

    if( this.userinfo != null )
    {
      base = this.userinfo + '<' + base + '>';
    }

    return base;
  }

});


