/**
 * Model for a call, to be subclassed by UACs
 *
 * A call is an interaction between exactly 2 SIP agents
 *
 */
CommExt.define( 'Comm.core.Call',
{
  extend: 'CommExt.util.Observable',


  /**
   * @event ringing
   * The call received a 180 Ringing response
   * @param {Comm.core.Call} call
   */

  /**
   * @event accepted
   * The call has been accepted (200 OK)
   * @param {Comm.core.Call} call
   */

  /**
   * @event declined
   * The call has been declined explicitly (603)
   * @param {Comm.core.Call} call
   */

  /**
   * @event busy
   * The call has been declined due to a busy callee (486,600)
   * @param {Comm.core.Call} call
   */

  /**
   * @event rejected
   * The call was rejected by some reason (not explicitly by the callee) Other 400/500/600
   * @param {Comm.core.Call} call
   */

  /**
   * @event notfound
   * The callee was not found (404)
   * @param {Comm.core.Call} call
   */

  /**
   * @event timeout
   * The callee could not be contacted on time (408 timeout)
   * @param {Comm.core.Call} call
   */

  /**
   * @event connected
   * The caller received our acceptance (ACK)
   * @param {Comm.core.Call} call
   */

  /**
   * @event release
   * The call was released (by either party, via a BYE)
   * @param {Comm.core.Call} call
   */

  /**
   * @event release_internal
   * Internal event indicating call release (BYE), fired before the RELEASE
   * @internal
   */

  /**
   * @event cancel
   * A call CANCEL was received or requested
   * @param {Comm.core.Call} call
   */

  /**
   * @event transfer_requested
   * A transfer (REFER) has been issued for this call
   * @param {String} address The address to refer
   */

  /**
   * @event transfer_progress
   * Received feedback (NOTIFY) of a transfer in progress
   * @param {Object} data With .call (of Comm.core.Call) and code: Number
   */

  /**
   * @event transfer_failed
   * The initiated tranfer failed (NOTIFY w. code > 400)
   * @param {Object} data With .call (of Comm.core.Call) and code: Number
   */

  /**
   * @event transfer_success
   * The initiated tranfer has been accepted by the third party
   * @param {Object} data With .call (of Comm.core.Call) and code: Number
   */


  /**
   * Available medias: audio
   *
   * @property {Number}
   */
  MEDIA_AUDIO: 1,


  /**
   * Available medias: video
   *
   * @property {Number}
   */
  MEDIA_VIDEO: 2,


  /**
   * From SIPURI
   *
   * @property {Comm.uri.SipUri}
   */
  from: null,


  /**
   * To SIPURI
   *
   * @property {Comm.uri.SipUri}
   */
  to: null,


  /**
   * Comm Call ID. Could not match any Call-id header.
   *
   * @property {String}
   */
  id: null,


  /**
   * Call automatic ring flag. If set, automatically answer with a 180 ringing to incoming calls.
   *
   * @property {Boolean}
   */
  autoring: true,


  /**
   * Wether an incoming/outgoing call has been connected (received ACK)
   *
   * @property {Boolean}
   */
  connected: false,


  /**
   * Wether an incoming/outgoing call has been released (received or sent BYE)
   *
   * @property {Boolean}
   */
  released: false,


  /**
   * Wether an incoming/outgoing call has been CANCELED (received or sent CANCEL)
   *
   * @property {Boolean}
   */
  canceled: false,


  /**
   * Wether an outgoing call has been rejected (response to invite >= 400)
   *
   * @property {Boolean}
   */
  rejected: false,


  /**
   * Wether an incoming or outgoing call has timed out while trying to reach the other party
   *
   * @property {Boolean}
   */
  timed_out: false,


  /**
   * Wether a released call has been released by the local party.
   *
   * @property {Boolean}
   */
  released_by_local_party: false,


  /*
   * Is this call an incoming or outgoing call?
   *
   * @property {Boolean}
   * @private
   */
  _is_incoming: false,


  /**
   * Statistics
   *
   * @property {Object}
   * @private
   */
  _stats: null,


  /**
   * Bitmap of available medias (see Comm.core.Call.MEDIA_*)
   *
   * @property {Number}
   */
  media: 0,



  /**
   * Constructor
   *
   * @param {String} id
   */
  constructor: function( id )
  {
    this.id = id || this._generate_unique_id();
    this.media = this.MEDIA_AUDIO | this.MEDIA_VIDEO;
    this.callParent();
  },



  /**
   * Check if call is active
   *
   * @return {boolean}
   */
  is_active: function()
  {
    return ( this.connected && !this.canceled && !this.released && !this.timed_out );
  },



  /**
   * Get a header from the initial invite/200 IF AVAILABLE
   *
   * @param {String} name
   * @return {String}
   */
  get_header: function( name )
  {
    return null;
  },



  /**
   * Check if a call is incoming or outgoing
   *
   * @return {Boolean}
   */
  is_incoming: function()
  {
    return this._is_incoming;
  },



  /**
   * Get the remote party (i.e. not us)
   *
   * @return {Comm.uri.SipUri}
   */
  get_remote_party: function()
  {
    return this._is_incoming ? this.from : this.to;
  },



  /**
   * Get the local party (i.e. US)
   *
   * @return {Comm.uri.SipUri}
   */
  get_local_party: function()
  {
    return this._is_incoming ? this.to : this.from;
  },



  /**
   * Generate a (hopefully) unique id for a call
   *
   * @return {String}
   * @protected
   */
  _generate_unique_id: function()
  {
    var ts = ( new Date() ).getTime().toString();
    ts += Math.round( Math.random() * ( 10e10 ) ).toString();
    return ts;
  },



  /**
   * Get call internal id
   *
   * @return {String}
   */
  get_id: function()
  {
    return this.id;
  },



  /**
   * Start an outgoing call
   */
  connect: function(){},



  /**
   * Send a ringing indication
   */
  ringing: function(){},



  /**
   * Accept an incoming call
   */
  accept: function(){},



  /**
   * Decline an incoming call
   */
  decline: function(){},



  /**
   * Reject an incoming call due to being busy
   */
  busy: function(){},



  /**
   * Terminate the call
   */
  release: function(){},



  /**
   * Transfer the call to a third party
   *
   * @param {String} to
   */
  transfer: function( to ){},



  /**
   * Returns statistics
   *
   * @return {Object}
   */
  get_stats: function()
  {
    return this._stats;
  }

});

