/**
 * Statistics base class. Models the basic API to obtain call statistics
 *
 */
CommExt.define( 'Comm.core.Statistics',
{
  extend: 'CommExt.util.Observable',


  /**
   * Softphone instance
   *
   * @property {Comm.core.Softphone}
   * @protected
   */
  _softphone: null,


  /**
   * Call to manage statistics
   *
   * @property {Comm.Call}
   * @protected
   */
  _call: null,


  /**
   * Timer to audit the call
   *
   * @property {Number}
   * @protected
   */
  _timer_id: null,


  /**
   * Frequency of statistics capture, in milliseconds
   *
   * @property {Number}
   */
  FREQUENCY: 5000,



  /**
   * Creates a Statistics manager
   *
   * @param {Comm.core.Softphone} softphone
   */
  constructor: function( softphone )
  {
    this._softphone = softphone;
    this.callParent();
  },



  /**
   * Start capturing statistics
   *
   * @param {Comm.Call=} call
   */
  start_capturing: function( call )
  {
    if( !call )
    {
      if( CommExt.Object.isEmpty( this._softphone.Uac.calls ) )
      {
        Comm.Log.info( '[Comm.core.Statistics.start_capturing] no calls available to capture' );
        return;
      }

      // Get the first call
      call = CommExt.Object.getValues( this._softphone.Uac.calls )[0];
    }

    Comm.Log.info( '[Comm.core.Statistics.start_capturing] Initializing for call ' + call.get_id() );

    this._call = call;

    call.on( 'released', this._on_call_released, this );

    if( call.connected )
    {
      this._on_call_connected();
    }
    else
    {
      call.on( 'connected', this._on_call_connected, this );
    }
  },



  /**
   * On call connected, start the timer to capture statistics snapshots
   *
   * @protected
   */
  _on_call_connected: function()
  {
    Comm.Log.debug( '[Comm.core.Statistics._on_call_connected] Start capturing statistics' );
    this._timer_id = setInterval( CommExt.bind( this._capture_statistics_snapshot, this ), this.FREQUENCY );
  },



  /**
   * On call released, stop the timer capturing statistics snapshots.
   *
   * @protected
   */
  _on_call_released: function()
  {
    clearInterval( this._timer_id );
  },



  /**
   * Capture one statistics snapshot.
   * This method must be implemented by the child class.
   *
   * @protected
   */
  _capture_statistics_snapshot: function()
  {
    Comm.Log.debug( '[Comm.core.Statistics._on_call_connected] Capture statistics snapshot' );
  }

});

