CommExt.define( 'Comm.core.Settings',
{
  prefix: '',
  extend: 'CommExt.util.Observable',


  /**
   * Tuning values
   *
   * @property {String}
   */
  TUNING: 'tuning',


  /**
   * ActiveX version
   *
   * @property {String}
   */
  VERSION: 'version',


  /**
   * Audio input settings
   *
   * @property {String}
   */
  AUDIOINPUT_DEVICE_ID: 'audioinput_device_id',
  AUDIOINPUT_PROFILE: 'audioinput_profile',
  AUDIOINPUT_NAME: 'audioinput_name',
  AUDIOINPUT_TAG: 'audioinput_tag',
  AUDIOINPUT_MUTE: 'audioinput_mute',
  AUDIOINPUT_VOLUME: 'audioinput_volume',


  /**
   * Audio output settings
   *
   * @property {String}
   */
  AUDIOOUTPUT_DEVICE_ID: 'audiooutput_device_id',
  AUDIOOUTPUT_NAME: 'audiooutput_name',
  AUDIOOUTPUT_TAG: 'audiooutput_tag',
  AUDIOOUTPUT_MUTE: 'audiooutput_mute',
  AUDIOOUTPUT_VOLUME: 'audiooutput_volume',


  /**
   * Audio ringtone output settings
   *
   * @property {String}
   */
  AUDIORINGTONEOUTPUT_DEVICE_ID: 'audioringtoneoutput_device_id',
  AUDIORINGTONEOUTPUT_NAME: 'audioringtoneoutput_name',
  AUDIORINGTONEOUTPUT_TAG: 'audioringtoneoutput_tag',
  AUDIORINGTONEOUTPUT_MUTE: 'audioringtoneoutput_mute',
  AUDIORINGTONEOUTPUT_VOLUME: 'audioringtoneoutput_volume',


  /**
   * Audio headset
   *
   * @property {String}
   */
  HEADSET: 'headset',


  /**
   * Video settings
   *
   * @property {String}
   */
  VIDEOINPUT_DEVICE_ID: 'videoinput_device_id',
  VIDEOINPUT_PROFILE: 'videoinput_profile',
  VIDEOINPUT_NAME: 'videoinput_name',
  VIDEOINPUT_TAG: 'videoinput_tag',
  VIDEOINPUT_WIDTH: 'videoinput_width',
  VIDEOINPUT_HEIGHT: 'videoinput_height',
  VIDEOINPUT_FPS: 'videoinput_fps',
  VIDEOINPUT_BACK_LIGHT_COMPENSATION: 'videoinput_back_light_compensation',
  VIDEOINPUT_COLOR_ENABLE: 'videoinput_color_enable',
  VIDEOINPUT_WHITE_BALANCE: 'videoinput_white_balance',
  VIDEOINPUT_SHARPNESS: 'videoinput_sharpness',
  VIDEOINPUT_CONTRAST: 'videoinput_contrast',
  VIDEOINPUT_BRIGHTNESS: 'videoinput_brightness',
  VIDEOINPUT_GAMMA: 'videoinput_gamma',
  VIDEOINPUT_SATURATION: 'videoinput_saturation',
  VIDEOINPUT_HUE: 'videoinput_hue',
  VIDEOINPUT_GAIN: 'videoinput_gain',
  HARDWARE_ID: 'hardware_id',


  /**
   * Chroma settings
   *
   * @property {String}
   */
  CHROMA_R: 'chroma_r',
  CHROMA_G: 'chroma_g',
  CHROMA_B: 'chroma_b',
  CHROMA_ANGLE: 'chroma_angle',
  CHROMA_NOISE: 'chroma_noise',
  CHROMA_PICTURE: 'chroma_picture',


  /**
   * Items
   *
   * @var {Object}
   * @private
   */
  _items: {},



  /**
   * Constructor
   */
  constructor: function()
  {
    this.callParent( arguments );
    this.load();
  },



  /**
   * Loads items from storage
   */
  load: function()
  {
    this._items = this._get_items_from_storage();
  },



  /**
   * Saves items to storage
   */
  save: function()
  {
    localStorage.setItem( this._get_storage_name(), JSON.stringify( this._items ) );
  },



  /**
   * Set setting value
   *
   * @param {String} name
   * @param {String|Number} value
   */
  set: function( name, value )
  {
    Comm.Log.debug( '[Comm.core.Settings.set] Setting [' + name + '] [' + value + ']' );

    this.fireEvent( 'set', name, value );
    this._items[ name ] = value;
  },



  /**
   * Get setting value
   *
   * @param {String} name
   * @return {String}
   */
  get: function( name )
  {
    return this._items[ name ] || null;
  },



  /**
   * Check if settings have been acquired or not
   *
   * @return {Boolean}
   */
  check: function()
  {
    try
    {
      Comm.Log.info( '[Comm.core.Settings.check] Checking settings' );
      return !( !this.get( this.TUNING ) || !this.check_mandatory_settings() );
    }
    catch( exc )
    {
      Comm.Log.error( '[Comm.core.Settings.check] Error', exc );
      return false;
    }
  },



  /**
   * Checks if some mandatory setting is missing
   *
   * @return boolean
   */
  check_mandatory_settings: function()
  {
    Comm.Log.debug( '[Comm.core.Settings.check_mandatory_setting] Checking mandatory settings' );

    var mandatory_settings = this._get_mandatory_settings();

    for( var i = 0; i < mandatory_settings.length; i++ )
    {
      if( !this.get( mandatory_settings[ i ] ) )
      {
        Comm.Log.warning( '[Comm.core.Settings.check_mandatory_setting] Mandatory setting not found: ' + mandatory_settings[ i ] );
        return false;
      }
    }

    return true;
  },



  /**
   * Resets tuning settings to "unknown"
   */
  reset: function()
  {
    Comm.Log.debug( '[Comm.core.Settings.reset] Reseting settings' );
    this.set( this.TUNING, null );
  },



  /**
   * Finish tuning
   * Set param TUNING to 1
   *
   */
  finish: function()
  {
    this.set( this.TUNING, 1 );
  },



  /**
   * Returns the storage name
   *
   * @returns {String}
   * @private
   */
  _get_storage_name: function()
  {
    return this.prefix + 'comm_settings';
  },



  /**
   * Returns the mandatory settings
   *
   * @return {Array}
   * @private
   */
  _get_mandatory_settings: function()
  {
    return [];
  },



  /**
   * Returns all items from storage
   *
   * @return {Object}
   * @private
   */
  _get_items_from_storage: function()
  {
    var data = localStorage.getItem( this._get_storage_name() );
    return data ? JSON.parse( data ) : {};
  }

});
