/**
 * Simple touch componentizer, with events for quick tap, long hold press/release
 *
 */
CommExt.define( 'Comm.axiscamera.TouchControl',
{
  alternateClassName: [ 'Comm.AxisCamera.TouchControl' ],
  extend: 'CommExt.util.Observable',
  config:
  {

    /**
     * Div id
     *
     * @property {String|Object}
     */
    id: null,


    /**
     * Hold press time
     *
     * @property {Number}
     */
    hold_press_time: 200
  },


  /**
   * @event hold_release
   */

  /**
   * @event quick_press
   */

  /**
   * @event hold_press
   */


  /**
   * Pressing
   *
   * @property {Boolean}
   * @private
   */
  _pressing: false,


  /**
   * Press time
   *
   * @property {Number}
   * @private
   */
  _presstime: 0,


  /**
   * Release time
   *
   * @property {Number}
   * @private
   */
  _releasetime: 0,


  /**
   * Press event
   *
   * @property {Object}
   * @private
   */
  _press_event: null,


  /**
   * Timer id
   *
   * @property {Number}
   * @private
   */
  _timer_id: null,



  /**
   * Constructor
   *
   * @param {Object} config
   */
  constructor: function( config )
  {
    this.initConfig( config );
    this.callParent( arguments );

    this._presstime = this._releasetime = 0;

    if( typeof this.config.id == 'object' )
    {
      this.config.id.onmouseout = CommExt.bind( this._on_release, this );
      this.config.id.onmousedown = CommExt.bind( this._on_press, this );
      this.config.id.onmouseup = CommExt.bind( this._on_release, this );
    }
    else
    {
      CommExt.get( this.config.id ).on( 'mouseout', this._on_release, this );
      CommExt.get( this.config.id ).on( 'mousedown', this._on_press, this );
      CommExt.get( this.config.id ).on( 'mouseup', this._on_release, this );
    }

  },



  /**
   * Stop listening to events
   */
  stop: function()
  {
    if( this.config.id && CommExt.get( this.config.id ) )
    {
      if( typeof this.config.id == 'object' )
      {
        this.config.id.onmouseout = CommExt.un( this._on_release, this );
        this.config.id.onmousedown = CommExt.un( this._on_press, this );
        this.config.id.onmouseup = CommExt.un( this._on_release, this );
      }
      else
      {
        CommExt.get( this.config.id ).un( 'mouseout', this._on_release, this );
        CommExt.get( this.config.id ).un( 'mousedown', this._on_press, this );
        CommExt.get( this.config.id ).un( 'mouseup', this._on_release, this );
      }
    }
  },



  /**
   * On press
   *
   * @param {Object} e
   * @private
   */
  _on_press: function( e )
  {
    this._pressing = true;
    this._presstime = (new Date()).getTime();
    this._press_event = e;
    this._timer_id = CommExt.defer( this._timer_callback, this.config.hold_press_time, this );
  },



  /**
   * On release
   *
   * @param {Object} e
   * @private
   */
  _on_release: function( e )
  {
    if( this._pressing == false )
    {
      return;
    }

    clearTimeout( this._timer_id );
    this._pressing = false;
    this._releasetime = (new Date()).getTime();

    if( this._releasetime - this._presstime > this.config.hold_press_time )
    {
      this.fireEvent( 'hold_release', e );
    }
    else
    {
      this.fireEvent( 'quick_press', this._press_event );
    }
  },



  /**
   * Timer callback
   *
   * @private
   */
  _timer_callback: function()
  {
    this._is_hold_press = true;
    this.fireEvent( 'hold_press', this._press_event );
  }

});

/**
 * UI Control for the Axis Camera window
 *
 */
CommExt.define( 'Comm.axiscamera.Ui',
{
  singleton: true,
  alternateClassName: [ 'Comm.AxisCamera.Ui', 'Comm.AxisCamera.ui' ],


  /**
   * Timeout to save a position. One-second press
   *
   * @property {Number}
   */
  SAVEPOSTIMEOUT: 1000,


  /**
   * Up button ID on the control UI
   *
   * @property {String}
   */
  UP: 'up',


  /**
   * Down button ID on the control UI
   *
   * @property {String}
   */
  DOWN: 'down',


  /**
   * Left button ID on the control UI
   *
   * @property {String}
   */
  LEFT: 'left',


  /**
   * Right button ID on the control UI
   *
   * @property {String}
   */
  RIGHT: 'right',


  /**
   * Zoom in button ID on the control UI
   *
   * @property {String}
   */
  ZOOMIN: 'zoom_in',


  /**
   * Zoom out button ID on the control UI
   *
   * @property {String}
   */
  ZOOMOUT: 'zoom_out',


  /**
   * One button ID on the control UI
   *
   * @property {String}
   */
  ONE: 'one',


  /**
   * Two button ID on the control UI
   *
   * @property {String}
   */
  TWO: 'two',


  /**
   * Three button ID on the control UI
   *
   * @property {String}
   */
  THREE: 'three',


  /**
   * Stores the created touchcontrols
   * Indexed by controls container id.
   *
   * @property {Object}
   * @private
   */
  _touchcontrols: {},



  /**
   * Start the controls for the axiscamera on a given div, with a given set of controls shown on double click
   *
   * @param {String} div_id The container div id
   * @param {String} controls_id The controls div id (if null, won't use)
   * @param {Boolean} use_css_classes
   */
  initialize: function( div_id, controls_id, use_css_classes )
  {
    Comm.Log.debug( '[Comm.axiscamera.Ui.initialize] Initialize [' + div_id + '] [' + controls_id + ']' );

    // ******************************
    // Window events
    // ******************************
    this._setup_window_observers( div_id );


    // ******************************
    // Controls events
    // ******************************
    if( !this._touchcontrols[ controls_id ] )
    {
      this._touchcontrols[ controls_id ] = [];
    }

    if( this._touchcontrols[ controls_id ].length > 0 )
    {
      CommExt.Array.each( this._touchcontrols[ controls_id ], function( t ){ t.stop(); } );
      this._touchcontrols[ controls_id ] = [];
    }

    if( controls_id )
    {
      var selector_prefix = ( use_css_classes === true ) ? '.' : '#';

      var move_buttons_names =
      [
        this.UP,
        this.DOWN,
        this.LEFT,
        this.RIGHT,
        this.ZOOMIN,
        this.ZOOMOUT
      ];

      var relmove =
      [
        [ 0, 5, 0 ], // up
        [ 0, -5, 0 ], // down
        [ -5, 0, 0 ], // left
        [ 5, 0, 0 ], // right
        [ 0, 0, 5 ], // zoom in
        [ 0, 0, -5 ] // zoom out
      ];

      var contmove =
      [
        [ 0, 10, 0 ],
        [ 0, -10, 0 ],
        [ -10, 0, 0 ],
        [ 10, 0, 0 ],
        [ 0, 0, 10 ],
        [ 0, 0, -10 ]
      ];

      CommExt.Array.each( move_buttons_names, function( button_name, i )
      {
        var button_id = CommExt.select( '#' + controls_id + ' ' + selector_prefix + button_name ).elements[0];
        var touchctl = new Comm.axiscamera.TouchControl(
        {
          id: button_id,
          listeners:
          {
            scope: Comm.axiscamera.Camera,
            quick_press: CommExt.pass( Comm.axiscamera.Camera.moverel, [ relmove[i][0], relmove[i][1], relmove[i][2] ] ),
            hold_press: CommExt.pass( Comm.axiscamera.Camera.continuous_move, [ contmove[i][0], contmove[i][1], contmove[i][2] ] ),
            hold_release: CommExt.pass( Comm.axiscamera.Camera.continuous_move, [ 0, 0, 0 ] )
          }
        });
        this._touchcontrols[ controls_id ].push( touchctl );
      }, this );


      var save_position_names =
      [
        this.ONE,
        this.TWO,
        this.THREE
      ];

      CommExt.Array.each( save_position_names, function( position_name )
      {
        var button_id = CommExt.select( '#' + controls_id + ' ' + selector_prefix + position_name ).elements[0];
        var saveposctl = new Comm.axiscamera.TouchControl(
        {
          id: button_id,
          hold_press_time: 600,
          listeners:
          {
            scope: Comm.axiscamera.Camera,
            quick_press: CommExt.pass( Comm.axiscamera.Camera.goto_saved_pos, [ position_name ] ),
            hold_press: function(){},
            hold_release: CommExt.pass( Comm.axiscamera.Camera.save_pos, [ position_name ] )
          }
        });
        this._touchcontrols[ controls_id ].push( saveposctl );
      }, this );
    }
  },



  /**
   * Setup the mouseup and mousewheel observers.
   *
   * @param {String} div_id The id of the div to observe
   * @private
   */
  _setup_window_observers: function( div_id )
  {
    if( div_id && CommExt.get( div_id ) )
    {
      // Mouse wheel
      CommExt.get( div_id ).un( 'mousewheel', this._on_mouse_wheel, this );
      CommExt.get( div_id ).on( 'mousewheel', this._on_mouse_wheel, this );

      // Win Click
      if( !CommExt.get( div_id ).dom.winclick_handler )
      {
        CommExt.get( div_id ).dom.winclick_handler = CommExt.bind( this._on_win_click, this, [ div_id ], 0 );
      }

      var winclick_handler = CommExt.get( div_id ).dom.winclick_handler;
      CommExt.get( div_id ).un( 'mouseup', winclick_handler, this );
      CommExt.get( div_id ).on( 'mouseup', winclick_handler, this );
    }
  },



  /**
   * Stop the mouseup and mousewheel observers.
   *
   * @param {String} div_id The id of the div to observe
   * @private
   */
  _stop_window_observers: function( div_id )
  {
    if( div_id && CommExt.get( div_id ) )
    {
      var video_window = CommExt.get( div_id )
      video_window.removeAllListeners();
    }
  },



  /**
   * Returns winclick handler
   *
   * @param {String} div_id
   * @param {Object} event
   * @private
   */
  _on_win_click: function( div_id, event )
  {
    var div = CommExt.get( div_id );
    var x = event.getPageX() - div.getLeft( false );
    var y = event.getPageY() - div.getTop( false );
    var w = div.getWidth();
    var h = div.getHeight();

    Comm.Log.info( '[Comm.axiscamera.Ui._handle_winclick] Clicked at ' + x + ',' + y + ' of ' + w + 'x' + h );
    Comm.axiscamera.Camera.center( w, h, x, y );
  },



  /**
   * Returns wheel handler
   *
   * @param {Object} event
   * @private
   */
  _on_mouse_wheel: function( event )
  {
    var delta = event.getWheelDelta();

    if( delta )
    {
      Comm.Log.info( '[Comm.axiscamera.Ui._on_mouse_wheel] Delta: ' + 50 * delta );
      Comm.axiscamera.Camera.deltazoom( 50 * delta );
    }

    event.preventDefault();
  },



  /**
   * Stops the controls for the axiscamera on a given div, with a given set of controls shown on double click
   *
   * @param {String} div_id The container div id
   * @param {String} controls_id The controls div id (if null, won't use)
   * @param {Boolean} use_css_classes
   */
  end: function( div_id, controls_id, use_css_classes )
  {
    Comm.Log.debug( '[Comm.axiscamera.Ui.end] End controls detection [' + div_id + '] [' + controls_id + ']' );

    // ******************************
    // Window events
    // ******************************
    this._stop_window_observers( div_id );


    // ******************************
    // Controls events
    // ******************************
    if( controls_id && this._touchcontrols[ controls_id ] )
    {
      this._touchcontrols[ controls_id ].forEach( function( control )
      {
        control.destroy();
      }.bind( this ) );
    }
  }

});
