CommExt.define( 'Comm.webrtc.utils.ChromaMediaStream',
{
  extend: 'CommExt.util.Observable',
  config:
  {

    /**
     * Width
     *
     * @property {Number}
     */
    width: null,


    /**
     * Height
     *
     * @property {Number}
     */
    height: null,


    /**
     * Background image URL
     * Cross domain URLs requires CORS header
     *
     * @property {String}
     */
    image: null,


    /**
     * Source media stream
     *
     * @property {Object}
     */
    source_media_stream: null
  },



  /**
   * Constructor
   *
   * @param {Object} config
   */
  constructor: function( config )
  {
    this.initConfig( config );
    this.callParent( arguments );

    this._prepare();
    this._draw();
  },



  /**
   * Returns canvas media stream
   *
   * @returns {Object}
   */
  get_stream: function()
  {
    if( !this._canvas_stream )
    {
      this._canvas_stream = this._canvas_destination.captureStream( 25 );
    }

    return this._canvas_stream;
  },



  /**
   * Prepares
   *
   * @private
   */
  _prepare: function()
  {
    var w = this.config.width;
    var h = this.config.height;

    this._bg_image = new Image();
    this._bg_image.crossOrigin = 'Anonymous';
    this._bg_image.width = w;
    this._bg_image.height = h;
    this._bg_image.src = this.config.image;

    this._video = document.createElement( 'video' );
    this._video.width = w;
    this._video.height = h;

    try
    {
      this._video.srcObject = this.config.source_media_stream;
    }
    catch( error )
    {
      this._video.src = window.URL.createObjectURL( this.config.source_media_stream );
    }

    this._tmp_canvas = document.createElement( 'canvas' );
    this._tmp_canvas.width = w;
    this._tmp_canvas.height = h;
    this._tmp_canvas_ctx = this._tmp_canvas.getContext( '2d' );

    this._canvas_destination = document.getElementById( 'chroma_canvas' );

    if( !this._canvas_destination )
    {
      this._canvas_destination = document.createElement( 'canvas' );
      this._canvas_destination.id = 'chroma_canvas';
      this._canvas_destination.style.visibility = 'hidden';
      this._canvas_destination.style.position = 'absolute';
      this._canvas_destination.style.top = '-9999px';
      document.body.appendChild( this._canvas_destination );
    }

    this._canvas_destination.width = w;
    this._canvas_destination.height = h;
  },



  /**
   * Draw
   *
   * @private
   */
  _draw: function()
  {
    if( this._canvas_stream && this._canvas_stream._phe_stopped )
    {
      return;
    }

    var w = this.config.width;
    var h = this.config.height;

    this._tmp_canvas_ctx.drawImage( this._video, 0, 0, w, h );
    var imgData = this._tmp_canvas_ctx.getImageData( 0, 0, w, h );

    this._replaceGreen( imgData.data );

    this._tmp_canvas_ctx.putImageData( imgData, 0, 0 );

    var canvas_destination_ctx = this._canvas_destination.getContext( '2d' );
    canvas_destination_ctx.drawImage( this._bg_image, 0, 0, w, h );
    canvas_destination_ctx.drawImage( this._tmp_canvas, 0, 0 );

    //window.requestAnimationFrame( this._draw.bind( this ) );
    setTimeout( this._draw.bind( this ), 0 );
  },



  /**
   * Replace green
   *
   * Based on: https://github.com/kaustavdm/opentok-green-screen/blob/master/assets/js/canvas-draw.js
   *
   * @param {Object} data
   * @returns {Object}
   * @private
   */
  _replaceGreen: function( data )
  {
    var len = data.length;

    for( var i = 0, j = 0; j < len; i++, j += 4 )
    {
      // Convert from RGB to HSL
      var hsl = this._rgb2hsl( data[j], data[j + 1], data[j + 2] );
      var h = hsl[0], s = hsl[1], l = hsl[2];

      // Check if we have a somewhat green pixel
      //if (h >= 90 && h <= 160 && s >= 25 && s <= 90 && l >= 20 && l <= 75 ) {
      if( h >= 90 && h <= 135 /*&& s >= 25 && s <= 90 && l >= 20 && l <= 75*/ )
      {
        data[ j + 3 ] = 0;
      }
    }

    return data;
  },



  /**
   * RGB to HSL
   *
   * @param {Number} r
   * @param {Number} g
   * @param {Number} b
   * @returns {Array}
   * @private
   */
  _rgb2hsl: function( r, g, b )
  {
    r /= 255; g /= 255; b /= 255;

    var min = Math.min( r, g, b );
    var max = Math.max( r, g, b );
    var delta = max - min;
    var h, s, l;

    if( max == min )
    {
      h = 0;
    }
    else if( r == max )
    {
      h = ( g - b ) / delta;
    }
    else if( g == max )
    {
      h = 2 + ( b - r ) / delta;
    }
    else if( b == max )
    {
      h = 4 + ( r - g ) / delta;
    }

    h = Math.min( h * 60, 360 );

    if( h < 0 )
    {
      h += 360;
    }

    l = ( min + max ) / 2;

    if( max == min )
    {
      s = 0;
    }
    else if( l <= 0.5 )
    {
      s = delta / ( max + min );
    }
    else
    {
      s = delta / ( 2 - max - min );
    }

    return [ h, s * 100, l * 100 ];
  }

});

