/**
 * Utility methods
 *
 */
CommExt.define( 'Comm.webrtc.utils.Utils',
{
  singleton: true,



  /**
   * Checks TURN server
   * Based on: https://webrtc.github.io/samples/src/content/peerconnection/trickle-ice/
   *
   * @param {Object} options
   * @return {Promise}
   * @deprecated
   */
  check_turn_server: function( options )
  {
    Comm.Log.warning( '[Comm.webrtc.utils.Utils.check_turn_server] Using deprecated method check_turn_server. You must use check_ice_servers.' );

    return new Promise( function( resolve, reject )
    {
      // Create a PeerConnection with no streams, but force a m=audio line.
      var config =
      {
        iceTransportPolicy: 'relay', // all or relay
        rtcpMuxPolicy: 'require', // negotiate or require
        iceServers:
        [
          {
            urls: 'turn:' + options.server,
            username: options.username,
            credential: options.password
          }
        ]
      };

      var candidates = [];
      var pcConstraints = {};
      var offerOptions = { offerToReceiveAudio: 1 };

      var pc = new RTCPeerConnection( config, pcConstraints );

      pc.onicecandidate = function( event )
      {
        if( event.candidate )
        {
          var c = this._parse_candidate( event.candidate.candidate );
          candidates.push( c );
          pc.close();
          resolve();
        }
        else
        {
          pc.close();
          reject();
        }
      }.bind( this );

      pc.createOffer( offerOptions ).then( function( desc )
      {
        pc.setLocalDescription( desc );
      });
    }.bind( this ) );
  },



  /**
   * Checks ICE servers given availability
   *
   * @param {Array} ice_servers Format as: https://www.w3.org/TR/webrtc/#dom-rtciceserver-urls
   */
  check_ice_servers: function( ice_servers )
  {
    return new Promise( function( resolve, reject )
    {
      // Create a PeerConnection with no streams, but force a m=audio line.
      var config =
      {
        iceTransportPolicy: 'relay', // all or relay
        rtcpMuxPolicy: 'require', // negotiate or require
        iceServers: ice_servers
      };

      var candidates = [];
      var offerOptions = { offerToReceiveAudio: 1 };

      var pc = new RTCPeerConnection( config );

      pc.onicecandidate = function( event )
      {
        if( event.candidate )
        {
          var c = this._parse_candidate( event.candidate.candidate );
          candidates.push( c );
          pc.close();
          resolve();
        }
        else
        {
          pc.close();
          reject();
        }
      }.bind( this );

      pc.createOffer( offerOptions )
        .then( function( desc )
        {
          pc.setLocalDescription( desc );
        });

    }.bind( this ) );
  },



  /**
   * Parse a candidate:foo string into an object, for easier use by other methods.
   *
   * @param {String} text
   * @return {Object}
   * @private
   */
  _parse_candidate: function( text )
  {
    var candidate_text = 'candidate:';
    var pos = text.indexOf( candidate_text ) + candidate_text.length;
    var fields = text.substr( pos ).split( ' ' );

    return {
      component: fields[1],
      type: fields[7],
      foundation: fields[0],
      protocol: fields[2],
      address: fields[4],
      port: fields[5],
      priority: fields[3]
    };
  }

});

