    this.Options = new Comm.webrtc.Options( options );
    this.Loader = new Comm.webrtc.Loader( this );
    this.Uac = new Comm.webrtc.Uac( this );
    this.MediaMixer = new Comm.webrtc.MediaMixer( this );
    this.Statistics = new Comm.core.Statistics( this );
    this.PhotoTaker = Comm.webrtc.PhotoTaker;
    this.Settings = Comm.webrtc.Settings;
    this.MediaDevices = new Comm.webrtc.MediaDevices( this );
    this.Tuning = new Comm.webrtc.Tuning( this );
    this.Capabilities = Comm.webrtc.Capabilities;
    this.Utils = Comm.webrtc.utils.Utils;
