    {
      this._jssip_rtcsession.on( 'phemium:peerconnectioncreated', function( peerconnection )
      {
        _register_peerconnection_events( peerconnection );
      });
    }
    // *******************************************
    // *******************************************

    Comm.Log.debug( '[Comm.webrtc.Call._register_event_listeners] Finished registring events' );
